import React from "react";
import Entry from "./Entry";


function App(props){
    return(
        <div>
            <h1>
                <span>emojipidia</span>
            </h1>
            <dl className="dictionary">
                <Entry 
                    emoji = {props.emoji}
                    name  = {props.name}
                    description = {props.description}
                />
                  
            </dl>
        </div>
    )
}
export default App;
